import  React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  MDBCard,
  MDBCardBody,
  MDBCardText,
  MDBCardImage
} from 'mdb-react-ui-kit';

// TODO remove, this demo shouldn't need to reset the theme.


export default function ListHouses() {
  const [data,setData]=useState([])
  const getData = ()=>{
    axios.get("http://localhost:3000/api/home/getAll")
    .then((response )=>{
      setData(response.data)
    })
  }
  useEffect(()=>{
    getData()
    

  })
  return (
    
 <div>
    <h2 style={{color :'#3b71ca' , marginLeft:"15px" }}>available real estates</h2>
    {data.map((house)=>{
         <MDBCard>
         <MDBCardImage src='https://mdbootstrap.com/img/new/standard/nature/182.webp' alt='...' position='top' />
         <MDBCardBody>
           <MDBCardText>
             {house.Home_City}
             {house.Home_Governorate}
           </MDBCardText>
         </MDBCardBody>
       </MDBCard>
    })}
 </div>
  );
}
